import "./navbar.css";
import {Link} from "react-router-dom";

function Navbar() {
  return (
    <div className="navbar">
        {/* the logo secton */}
        <div className="navbar_logo">
            <h2>U'R SHOP</h2>
        </div>
      
       {/* the links session */}
       <ul className="navbar_links">
            <li>
              <Header />
                <Link to="/cart">
                  <i className="fas fa-shopping-cart"></i>
                    Cart
                    <span className="cartlogo_badge">0</span>
                </Link>
            </li>

            <li>
                <Link to="/">
                  {/* icon */}
                    Shop
                </Link>
            </li>
       </ul>

       {/* hanburger menu */}
       <div className="Navbarger_menu">
        <div></div>
        <div></div>
        <div></div>
       </div>
    </div>
  );
}

export default Navbar;
